<Route path="/main" element={<Personal_cabinet/>}>
</Route>
</Routes>
    </div>
    <footer className="footer">
<ol>
        <li>г. Таганрог, ул. Маршала Жукова 2а-7</li>
        <li>ИП Минко Виктор Олегович</li>
        <li>Телефон: 89515008140</li>
    </ol>
</footer>
</div>
</>
  );
}

export default App;
